// Libraries
import React from 'react'
import { Link } from 'react-router'

// Components
import Button from 'shared/button'

const Arco = () => (
  <div className='content flex-center'>
    <Link
      to={
        'https://enconta-public.s3-us-west-2.amazonaws.com/environment/templates/Solicitud_Derechos_ARCO_Grupo.empresarial.Resuelve.pdf'
      }
      target={'_blank'}
    >
      <Button buttonStyle='primary' icon='cloud-download'>
        Descarga la solicitud de derechos ARCO
      </Button>
    </Link>
  </div>
)

export default Arco
